import React from "react";
import PropTypes from "prop-types";


const Card = (props) => {
    return (
        <div className="Title">{props.name}</div>
    );
};

Card.propTypes = {
    /**
     *  Name
     */
    name: PropTypes.string.isRequired,
};

export default Card;
